import React, { Component } from 'react';

class AddNews extends Component {
    render() {
        return (
            <div className='AddNews'>
                <form className='AddNews__Form'>
                    <ul>
                        <li>
                            <label for='title'>Title</label>
                            <textarea id='Title'/>
                        </li>
                        <li>
                            <label>News info</label>
                            <textarea id=''/> 
                        </li>
                    </ul>
                </form>
            </div>
        );
    }
}

export default AddNews;
